a:260:{i:0;a:1:{s:2:"id";s:19:"2391202014476279629";}i:1;a:1:{s:10:"short_code";s:11:"CEvQZAjDp9N";}i:2;a:1:{s:12:"created_time";i:1599273515;}i:3;a:1:{s:7:"caption";s:2126:".
.
.
リトアニアの首都ビリニュスから少し離れた所に
一風変わった場所に建てられたお城があります🏰
.
.
その名は、
.
.
「トラカイ城」
（英語名：Trakai Island Castle）
.
.
こちらのお城、見た目が非常に可愛く、
赤レンガで出来ており、
湖の上に浮かぶように建てられているので
まるでお伽話に出てきそうな外観をしています👑
.
.
ドラクエに出てくるお城に似ているとの声もあり
一部ファンの間では「ドラクエ城」とも
呼ばれているそう🤫🎮
.
.
市内からはバスで行くことができ、
片道約40分なので、
日帰りの観光地としても人気のスポットです😉❣️
.
.
トラカイ城は14世紀に建てられ、
建設当時は、牢獄、処刑場、別荘など、
様々な用途で使われていたようですが、
現在は博物館として
当時の衣装や調度品が展示されています。
.
.
建物からはまさに「中世のヨーロッパ」という
感じの雰囲気が味わえ、
綺麗なステンドグラスを見たり、
当時の人々の様子を知ることができます💡
.
.
行ってみると案外広い敷地だったので、
お城の中を見終わったら
周辺の散策をしてみるのも楽しいかと思います🕺🎶
.
.
－－－－－－－－－－－－－－－－－－
.
.
いかがでしたか😌💚
バルト三国というと日本ではまだ馴染みがないため、
ピンと来ない方が多かったかもしれません🤭
.
.
少しでも興味を持って頂けたら
いいね❤︎または保存をして、
次回旅行時にお役立てください🤗
.
.
📍トラカイ城、リトアニア
.
.
