В течение трех дней на проспекте Гядиминаса, на Кафедральной и Лукишкской площадях, площади В. Кудирки, в сквере возле Литовского национального музея, на набережной Нерис у Белого моста будут проходить концерты, выставки, ярмарки, спектакли, обучающие занятия.

Пришедших к Белому мосту ждет впечатляющая 3D-видеопроекция «Пространственная легкость бытия» непосредственно на воде реки Нерис.
На улице Салтонишкю среди новых офисных зданий будет установлена ​​инсталляция художника Юргиса Паулюкаса «Птицы города». С наступлением темноты она засияет в лучах освещения, созданного специально для «Дней столицы». Эта пространственная инсталляция будет светиться всю ночь, чтобы вы смогли запечатлеть себя в окружении более 1200 птиц.

